import React from 'react';
import UserList from '../Components/UserList';
import { useSelector } from 'react-redux';
import './homepage.css';

const HomePage = () => {
  const isLoggedIn = useSelector(store => store.isLoggedIn);

  return (
    <div>
      <div className="container">
        {isLoggedIn ? <h1> Giriş Başarılı - Hoşgeldin </h1> : <h1>HomePage</h1>}
      </div >
      <footer id="footer" className="py-5 bg-dark bottom-0">
        <div className="container"><p class="m-0 text-center text-white">Copyright &copy; Your Website 2022</p></div>
      </footer>

    </div>

  );
};

export default HomePage;
